    function replaceActionList(){
        //定位顶部菜单最外层容器
        const topMenuContainer = document.querySelector('.TabsComponent_tabsContainer__3BDUp.TabsComponent_wrap__3fEC7');
        // 若未找到容器
        if (!topMenuContainer)return;
        //  根据第一个按钮名称进行过滤 - 只处理特定菜单
        const firstButton = topMenuContainer.querySelector('.MuiButtonBase-root.MuiTab-root:first-child .MuiBadge-root');
        if (!firstButton)return;
        // 过滤第一个按钮的文本内容（去除可能的序号和空格）
        const firstButtonText = firstButton.textContent.trim().replace(/^[\d.]+\s*/, '');
        const targetFirstButtonTexts = ['翠野农场','材料','木板','即时回血','茶','Farmland','Material','Lumber','Instant Heal','Tea'];
        if (!targetFirstButtonTexts.includes(firstButtonText))return;
        // 移除顶部菜单特有的外层类，对齐侧边菜单外层结构
        topMenuContainer.classList.remove('TabsComponent_wrap__3fEC7');
        //  定位 MuiTabs 核心容器（负责菜单整体布局）
        const muiTabsRoot = topMenuContainer.querySelector('.MuiTabs-root.css-orq8zk');
        if (muiTabsRoot) {
            // 移除顶部横向类，添加侧边纵向类
            muiTabsRoot.classList.remove('css-orq8zk');
            muiTabsRoot.classList.add('MuiTabs-vertical', 'css-6x4ics');
        }
        // 定位菜单按钮容器（控制按钮排列方向）
        const muiTabsFlexContainer = topMenuContainer.querySelector('.MuiTabs-flexContainer.css-k008qs');
        if (muiTabsFlexContainer) {
            // 移除顶部横向类，添加侧边纵向类
            muiTabsFlexContainer.classList.remove('css-k008qs');
            muiTabsFlexContainer.classList.add('MuiTabs-flexContainerVertical', 'css-j7qwjs');
            muiTabsFlexContainer.setAttribute('aria-orientation', 'vertical');
        }
        // 定位菜单指示器（切换时的高亮条）
        const muiTabsIndicator = topMenuContainer.querySelector('.MuiTabs-indicator.css-ttwr4n');
        if (muiTabsIndicator) {
            // 移除顶部横向指示器类，添加侧边纵向指示器类
            muiTabsIndicator.classList.remove('css-ttwr4n');
            muiTabsIndicator.classList.add('css-7ozjwe');
            const firstSelectedTab = topMenuContainer.querySelector('.MuiTab-root.Mui-selected');
            if (firstSelectedTab) {
                const tabTop = firstSelectedTab.offsetTop;
                muiTabsIndicator.style.top = `${tabTop}px`;
            }
        }
        //父节点恢复横置
        const targetElement = document.querySelector('.TabsComponent_tabsComponent__3PqGp');
        if (targetElement)targetElement.classList.add('TabsComponent_vertical__2cPB7');
        //强制重绘
        const verticalTabs = document.querySelector('.MuiTabs-flexContainer.MuiTabs-flexContainerVertical');
        verticalTabs.style.flexDirection = 'column';
        verticalTabs.style.display = 'none';
        verticalTabs.offsetHeight;
        verticalTabs.style.display = 'flex';
    }

    let isHandled = false;
    const googleFontKeyword = 'fonts.googleapis.com';
    // 备用字体源
    const fallbackFontUrl = 'https://fonts.loli.net/css2?family=Roboto:wght@300;400;500;600;700&family=Lexend:wght@300;400;500;600;700&display=swap';
    function fontReplace(){
        const fontLinks = document.querySelectorAll('link[rel="stylesheet"]');
        fontLinks.forEach(link => {
            if (isHandled) return;
            if (link.href.includes(googleFontKeyword)) {
                // 通过link的sheet属性判断是否加载成功（跨域可能为null，但失败时一定为null）
                try {
                    // 跨域字体的sheet会抛错，非跨域失败时sheet为null
                    if (!link.sheet || typeof link.sheet.cssRules === 'undefined') {
                        handleFontFailure();
                    }
                } catch (err) {
                    // 跨域情况下无法访问sheet，需结合其他判断（如时间）
                    const loadTime = Date.now() - link.dataset.loadTime;
                    if (loadTime > 3000) { // 超过3秒未加载成功，视为失败
                        handleFontFailure();
                    }
                }
            }
        });

    }
    function handleFontFailure(){
        console.log("字体加载失败，开始替换国内字体");
        // 创建备用字体链接
        const fallbackLink = document.createElement('link');
        fallbackLink.rel = 'stylesheet';
        fallbackLink.href = fallbackFontUrl;
        const googleFontLink = Array.from(document.querySelectorAll('link[rel="stylesheet"]')).find(link =>
            link.href.includes('fonts.googleapis.com')
        );
        // 替换原链接或添加到head中
        document.head.replaceChild(fallbackLink, googleFontLink);
    }
